INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100101, /*unit_name*/"ヒヨリ", /*kana*/"ひより", /*prefab_id*/100101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/200, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/100101, /*cutin_2*/0, /*cutin1_star6*/100101, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵前線を押し返す笑顔の元気娘。\n前衛に対して大ダメージを与えるユニオンバーストと、\n自身の攻撃力を強化するスキルを持つ攻撃役。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100201, /*unit_name*/"ユイ", /*kana*/"ゆい", /*prefab_id*/100201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/800, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/100201, /*cutin_2*/0, /*cutin1_star6*/100201, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【魔法】最後衛から、味方の回復と補助を行う魔法士。\n打たれ弱いが高い魔法攻撃力を持ち、ランクを上げると\n攻撃も補助もバランスよくこなせるようになる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100301, /*unit_name*/"レイ", /*kana*/"れい", /*prefab_id*/100301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/250, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/100301, /*cutin_2*/0, /*cutin1_star6*/100301, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、一点突破で敵を討つ、孤高の剣士。\nユニオンバースト、スキル共に眼前の敵を倒す事に優れ、\n攻撃スキルやカウンターを駆使して前線を押し上げる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100401, /*unit_name*/"ミソギ", /*kana*/"みそぎ", /*prefab_id*/100401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/205, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/100401, /*cutin_2*/0, /*cutin1_star6*/100401, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】最前衛で、敵の物理攻撃を邪魔するいたずら娘。\n目の前の敵を暗闇状態にし、命中率を大幅に下げるほか、\n敵一体の物理攻撃力を下げるスキルを持つ。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100501, /*unit_name*/"マツリ", /*kana*/"まつり", /*prefab_id*/100501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/185, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/100501, /*cutin_2*/0, /*cutin1_star6*/100501, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛の、機敏な動きで敵をかき回す騎士見習い。\nユニオンバーストで相手の陣地の真ん中に飛び込み、\n自分の周囲を攻撃するスキルで相手を攻め立てる。", /*only_disp_owned*/0, /*start_time*/"2018/09/18 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100601, /*unit_name*/"アカリ", /*kana*/"あかり", /*prefab_id*/100601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/570, /*atk_type*/2, /*normal_atk_cast_time*/2.19, /*cutin_1*/100601, /*cutin_2*/0, /*cutin1_star6*/100601, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【魔法】中衛で、魔法パーティの強化を担う、双子の妹。\n敵の魔法防御力を大幅に下げるスキルや、魔法攻撃力を\n上昇させ、回復効果を付与するユニオンバーストを使う。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100701, /*unit_name*/"ミヤコ", /*kana*/"みやこ", /*prefab_id*/100701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/125, /*atk_type*/1, /*normal_atk_cast_time*/1.7, /*cutin_1*/100701, /*cutin_2*/0, /*cutin1_star6*/100701, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【物理】最前衛で、ひたすら敵の攻撃を避ける幽霊少女。\nスキルで幽霊に変身することで敵の攻撃を躱し、\nユニオンバーストでは敵をプリンにして食べてしまう。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100801, /*unit_name*/"ユキ", /*kana*/"ゆき", /*prefab_id*/100801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/805, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/100801, /*cutin_2*/0, /*cutin1_star6*/100801, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】後衛で物理パーティを補助する、歩く芸術作品。\n味方のユニオンバースト発動を早めるスキルのほか、\n暗闇状態にするスキルで敵の物理攻撃を封じる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/100901, /*unit_name*/"アンナ", /*kana*/"あんな", /*prefab_id*/100901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/440, /*atk_type*/2, /*normal_atk_cast_time*/2.25, /*cutin_1*/100901, /*cutin_2*/0, /*cutin1_star6*/100901, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【魔法】中衛から圧倒的な魔力で攻撃する、疾風の冥姫。\nユニオンバーストで敵全体に大ダメージを与えるが、\n高すぎる魔力の為、自分自身にも相応のリスクが生じる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101001, /*unit_name*/"マホ", /*kana*/"まほ", /*prefab_id*/101001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/795, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/101001, /*cutin_2*/0, /*cutin1_star6*/101001, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【魔法】後衛で味方のサポートを担当するメルヘン少女。\n味方全体を強化してＴＰを回復するユニオンバーストや、\nＨＰ回復、敵を暗闇にするスキルで戦況を好転させる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101101, /*unit_name*/"リノ", /*kana*/"りの", /*prefab_id*/101101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/700, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/101101, /*cutin_2*/0, /*cutin1_star6*/101101, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】後衛から、矢の雨を降らせる妹系アーチャー。\nクリティカル率を高める重ね掛け可能なスキルを持ち、\nダメージ回数の多いユニオンバーストをより強力にする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101201, /*unit_name*/"ハツネ", /*kana*/"はつね", /*prefab_id*/101201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/755, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/101201, /*cutin_2*/0, /*cutin1_star6*/101201, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛の、対物理パーティが得意な超能力ガール。\nスキルが物理攻撃の敵に対して真価を発揮するため、\n物理攻撃型の敵パーティを一網打尽にする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101301, /*unit_name*/"ナナカ", /*kana*/"ななか", /*prefab_id*/101301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/740, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/101301, /*cutin_2*/0, /*cutin1_star6*/101301, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛から多彩な魔法を放つ、オタク魔法少女。\n体力が一番多い相手を狙うユニオンバーストやスキルは、\n敵のＨＰ状況により攻撃対象が変わる高威力の魔法攻撃。", /*only_disp_owned*/0, /*start_time*/"2018/11/19 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101401, /*unit_name*/"カスミ", /*kana*/"かすみ", /*prefab_id*/101401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/730, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/101401, /*cutin_2*/0, /*cutin1_star6*/101401, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛で、相手の行動妨害に特化した名探偵。\n束縛や混乱を付与するスキルで相手の行動を妨害し、\n魔法防御力ダウンのフィールドを展開して王手をかける。", /*only_disp_owned*/0, /*start_time*/"2019/02/28 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101501, /*unit_name*/"ミサト", /*kana*/"みさと", /*prefab_id*/101501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/9, /*se_type*/7, /*move_speed*/450, /*search_area_width*/735, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/101501, /*cutin_2*/0, /*cutin1_star6*/101501, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛で魔法キャラを支援する、みんなの先生。\nユニオンバーストのＨＰ回復＆魔防アップ、先頭キャラの\n継続ＨＰ回復スキルは、味方の耐久力を大幅に高める。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101601, /*unit_name*/"スズナ", /*kana*/"すずな", /*prefab_id*/101601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/705, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/101601, /*cutin_2*/0, /*cutin1_star6*/101601, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【物理】後衛からクリティカル攻撃するカリスマモデル。\nダメージ2倍のクリティカルダメージは\nスキルによる攻撃力アップでさらに破壊力を増す。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101701, /*unit_name*/"カオリ", /*kana*/"かおり", /*prefab_id*/101701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/145, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/101701, /*cutin_2*/0, /*cutin1_star6*/101701, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】最前衛で、累積スキルでダメージを稼ぐ南国娘。\nスキル「精神統一」を発動すると、カオリが攻撃する度に\n敵に効果が累積し、次のダメージがどんどん増えていく。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/101801, /*unit_name*/"イオ", /*kana*/"いお", /*prefab_id*/101801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/715, /*atk_type*/2, /*normal_atk_cast_time*/2.6, /*cutin_1*/101801, /*cutin_2*/0, /*cutin1_star6*/101801, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【魔法】後衛で、敵全体を誘惑するセクシー先生。\n敵のＴＰを奪うスキルでユニオンバースト発動を遅らせ、\n誘惑のユニオンバーストを放ち、戦場を大混乱に陥れる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102001, /*unit_name*/"ミミ", /*kana*/"みみ", /*prefab_id*/102001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/360, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/102001, /*cutin_2*/0, /*cutin1_star6*/102001, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】中衛で、敵前衛を崩す、うさぎっこ。\nユニオンバーストは、最も近い敵に大ダメージを与えた後\n隣の敵にも攻撃するので、前衛を早期に攻め落とせる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102101, /*unit_name*/"クルミ", /*kana*/"くるみ", /*prefab_id*/102101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/240, /*atk_type*/1, /*normal_atk_cast_time*/1.675, /*cutin_1*/102101, /*cutin_2*/0, /*cutin1_star6*/102101, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】前衛で、味方の守りに特化した、極度の照れ屋。\nスキルで自分の周囲の物理、魔法防御力を上げつつ、\n近くの敵をスタンさせて足止めする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102201, /*unit_name*/"ヨリ", /*kana*/"より", /*prefab_id*/102201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/575, /*atk_type*/2, /*normal_atk_cast_time*/2.19, /*cutin_1*/102201, /*cutin_2*/0, /*cutin1_star6*/102201, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【魔法】中衛から、強力な魔法で攻め立てる、双子の姉。\n自身のＨＰと引き換えに魔法攻撃力を増幅し、\nユニオンバーストやスキルの威力を高めて攻撃する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102301, /*unit_name*/"アヤネ", /*kana*/"あやね", /*prefab_id*/102301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/210, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/102301, /*cutin_2*/0, /*cutin1_star6*/102301, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】前衛で、戦場をかき乱す、くまっ子。\nユニオンバーストで、相手を思い切り吹き飛ばすと同時に\nスタンと大ダメージを与えることで敵陣形を大きく乱す。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102501, /*unit_name*/"スズメ", /*kana*/"すずめ", /*prefab_id*/102501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/720, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/102501, /*cutin_2*/0, /*cutin1_star6*/102501, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【魔法】後衛で、回復と攻撃をこなすドジっ娘メイド。\n周りの味方のＨＰを回復しつつ物理攻撃力を高める\nスキルは、中衛・後衛の攻撃役と抜群の相性。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102601, /*unit_name*/"リン", /*kana*/"りん", /*prefab_id*/102601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/550, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/102601, /*cutin_2*/0, /*cutin1_star6*/102601, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】中衛で物理パーティを強化するものぐさ少女。\n味方の物理攻撃力をアップしつつ、味方の魔法防御を\n高めることで攻守ともにパーティをサポートする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102701, /*unit_name*/"エリコ", /*kana*/"えりこ", /*prefab_id*/102701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/230, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/102701, /*cutin_2*/0, /*cutin1_star6*/102701, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【物理】前衛で、毒スキルで敵を粉砕する、通称壊し屋。\n最高クラスの攻撃力を持ち、ユニオンバーストで\n敵にとどめを刺す毎に、その攻撃力はさらにアップする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102801, /*unit_name*/"サレン", /*kana*/"されん", /*prefab_id*/102801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/430, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/102801, /*cutin_2*/0, /*cutin1_star6*/102801, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】中衛で一発逆転を狙う、みんなのサレンママ。\nＨＰが下がるほどダメージが上昇するユニオンバーストと\n味方のＴＰを回復するスキルで、一気に形勢を逆転する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/102901, /*unit_name*/"ノゾミ", /*kana*/"のぞみ", /*prefab_id*/102901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/160, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/102901, /*cutin_2*/0, /*cutin1_star6*/102901, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【物理】前衛で、皆の壁になって戦うアイドルのぞみん。\n彼女がステージに立てば、味方の物理攻撃力が\n大きくアップし、さらに敵の注意を一手に惹き付ける。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/103001, /*unit_name*/"ニノン", /*kana*/"にのん", /*prefab_id*/103001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/415, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/103001, /*cutin_2*/0, /*cutin1_star6*/103001, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、強力な範囲攻撃を操る、忍術の使い手。\n範囲攻撃のスキルで敵を倒す事で、自分のＴＰを回復し、\n強力なユニオンバーストの発動頻度を上げる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/103101, /*unit_name*/"シノブ", /*kana*/"しのぶ", /*prefab_id*/103101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/365, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/103101, /*cutin_2*/0, /*cutin1_star6*/103101, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【物理】中衛で、父親のドクロを召喚して戦う霊能少女。\n召喚した父親は、自分とは別に攻撃を行ってくれるほか、\nダメージを代わりに受けてくれることもある。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/103201, /*unit_name*/"アキノ", /*kana*/"あきの", /*prefab_id*/103201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/180, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/103201, /*cutin_2*/0, /*cutin1_star6*/103201, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛で大暴れして攻める、令嬢剣士。\n自分の周りに、味方を回復するフィールドを作り出し、\n自ら前線を支え導く姿も、名家を背負う者のあるべき姿。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/103301, /*unit_name*/"マヒル", /*kana*/"まひる", /*prefab_id*/103301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/395, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/103301, /*cutin_2*/0, /*cutin1_star6*/103301, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】中衛で、相手の動きを乱す牧場主。\n敵前衛をノックバックさせることで、隊列を崩し、\n他のキャラが使う範囲攻撃の対象に敵を押し込む。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/103401, /*unit_name*/"ユカリ", /*kana*/"ゆかり", /*prefab_id*/103401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/405, /*atk_type*/1, /*normal_atk_cast_time*/2.4, /*cutin_1*/103401, /*cutin_2*/0, /*cutin1_star6*/103401, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】中衛から、バリアや回復で味方を守る元聖騎士。\n傷ついた味方のＨＰやＴＰを回復するスキルを操り、\n打ち合いで消耗した所を、ピンポイントでサポートする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/103601, /*unit_name*/"キョウカ", /*kana*/"きょうか", /*prefab_id*/103601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/810, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/103601, /*cutin_2*/0, /*cutin1_star6*/103601, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛から強力な魔法で攻撃するちびっこ優等生。\nスキルで魔法攻撃力を瞬間的に高めた後に放つ\nユニオンバーストは敵単体への威力抜群。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/103701, /*unit_name*/"トモ", /*kana*/"とも", /*prefab_id*/103701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/220, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/103701, /*cutin_2*/0, /*cutin1_star6*/103701, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で、素早い斬撃を仕掛け敵を屠る剣術少女。\nユニオンバーストで自分の攻撃力と行動速度を上昇させ、\nほか攻撃スキルの殲滅能力を極限まで高め敵を圧倒する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/103801, /*unit_name*/"シオリ", /*kana*/"しおり", /*prefab_id*/103801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/710, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/103801, /*cutin_2*/0, /*cutin1_star6*/103801, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】最後衛から高火力スキルを連発するスナイパー。\nダメージを与えつつ、ＴＰを回復するスキルを持ち、\n強力な一撃のユニオンバーストを、素早く発動する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104001, /*unit_name*/"アオイ", /*kana*/"あおい", /*prefab_id*/104001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/785, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/104001, /*cutin_2*/0, /*cutin1_star6*/104001, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【物理】最後衛から状態異常の矢を放つ、ぼっちの射手。\nダメージと共に付与する毒や麻痺の追加効果により、\n防御力の高い敵であっても、確実にＨＰを削りとる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104201, /*unit_name*/"チカ", /*kana*/"ちか", /*prefab_id*/104201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/790, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/104201, /*cutin_2*/0, /*cutin1_star6*/104201, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【魔法】後衛から、前衛の戦いをサポートする唱喚士。\nユニオンバーストで、味方の回復と敵への攻撃を行う\n精霊を最前線に唱喚する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104301, /*unit_name*/"マコト", /*kana*/"まこと", /*prefab_id*/104301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/165, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/104301, /*cutin_2*/0, /*cutin1_star6*/104301, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵の防御力を削り取る、正義の獣人。\n敵の盾役の防御力を下げ、着実にダメージを与えることで\n早期に敵の守りを突破する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104401, /*unit_name*/"イリヤ", /*kana*/"いりや", /*prefab_id*/104401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/425, /*atk_type*/2, /*normal_atk_cast_time*/1.425, /*cutin_1*/104401, /*cutin_2*/0, /*cutin1_star6*/104401, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】中衛で命を削り攻撃する「夜を統べる者」。\n自身のＨＰと引き換えに放つスキルは高い殲滅力を誇り\n範囲攻撃における威力では他の追随を許さない。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104501, /*unit_name*/"クウカ", /*kana*/"くうか", /*prefab_id*/104501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/130, /*atk_type*/1, /*normal_atk_cast_time*/2.375, /*cutin_1*/104501, /*cutin_2*/0, /*cutin1_star6*/104501, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】前衛で囮となり、攻撃を引き付ける暴走ドＭ娘。\nユニオンバーストにより、自身に魔法バリアを張り、\n敵の魔法攻撃を吸収してＨＰを回復する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104601, /*unit_name*/"タマキ", /*kana*/"たまき", /*prefab_id*/104601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/215, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/104601, /*cutin_2*/0, /*cutin1_star6*/104601, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛の、対魔法パーティが得意な気まぐれ猫娘。\n攻撃スキルは、「魔法攻撃力が一番高い敵」を狙い撃ち、\nダメージ、魔法攻撃力ダウン、ＴＰ吸収と畳み掛ける。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104701, /*unit_name*/"ジュン", /*kana*/"じゅん", /*prefab_id*/104701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/135, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/104701, /*cutin_2*/0, /*cutin1_star6*/104701, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】最前衛で、完全防御スキルを操る騎士団長。\nユニオンバーストであらゆるダメージを吸収するバリアを\n展開できる。特に長期戦で圧倒的な防御性能を誇る。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104801, /*unit_name*/"ミフユ", /*kana*/"みふゆ", /*prefab_id*/104801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/420, /*atk_type*/1, /*normal_atk_cast_time*/2.19, /*cutin_1*/104801, /*cutin_2*/0, /*cutin1_star6*/104801, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】中衛の、スタンと回復のスキルを持つ傭兵戦士。\n高い防御力と自己回復能力を併せ持つ事で、\n中衛の守りを堅固にし、パーティを底支えする。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/104901, /*unit_name*/"シズル", /*kana*/"しずる", /*prefab_id*/104901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/285, /*atk_type*/1, /*normal_atk_cast_time*/2.375, /*cutin_1*/104901, /*cutin_2*/0, /*cutin1_star6*/104901, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】前衛で、物理攻撃から味方を守る、お姉ちゃん。\nスキルで物理無効バリアを展開し、味方全員を守るほか、\n自身はさらに物理吸収バリアを纏い、敵前衛を討つ。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105001, /*unit_name*/"ミサキ", /*kana*/"みさき", /*prefab_id*/105001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/760, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/105001, /*cutin_2*/0, /*cutin1_star6*/105001, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【魔法】後衛から、範囲攻撃を行う、レディ・ウィッチ。\n複数回の範囲攻撃を放つスキルや、目の前の敵全てを\n攻撃するユニオンバーストを持ち、範囲殲滅に特化する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105101, /*unit_name*/"ミツキ", /*kana*/"みつき", /*prefab_id*/105101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/565, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/105101, /*cutin_2*/0, /*cutin1_star6*/105101, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【物理】中衛で、敵弱体化フィールドを操る隻眼の悪魔。\nフィールドの持続時間は短いが、範囲内の敵の\n物理防御力を大幅に減らす効果を持つ。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105201, /*unit_name*/"リマ", /*kana*/"りま", /*prefab_id*/105201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/105, /*atk_type*/1, /*normal_atk_cast_time*/2.215, /*cutin_1*/105201, /*cutin_2*/0, /*cutin1_star6*/105201, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】最前衛で味方を守る、恋する乙女。\nバトル開始後、しばらくしてから最前線まで\n突進してきて、敵の目の前に立ちはだかる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105301, /*unit_name*/"モニカ", /*kana*/"もにか", /*prefab_id*/105301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/410, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/105301, /*cutin_2*/0, /*cutin1_star6*/105301, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、味方の攻撃を鼓舞する、軍人娘。\n味方全体の物理、魔法攻撃力の大幅アップに加えて、\n攻撃速度もあげることで、戦闘の早期終結を実現する。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105401, /*unit_name*/"ツムギ", /*kana*/"つむぎ", /*prefab_id*/105401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/2, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/195, /*atk_type*/1, /*normal_atk_cast_time*/2.42, /*cutin_1*/105401, /*cutin_2*/0, /*cutin1_star6*/105401, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵の妨害に特化したテーラーガール。\n敵を強制的に移動させる事で陣形を崩し、さらに\n移動速度・行動速度を低下させ相手の反撃を遅らせる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105501, /*unit_name*/"アユミ", /*kana*/"あゆみ", /*prefab_id*/105501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/510, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/105501, /*cutin_2*/0, /*cutin1_star6*/105501, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、どたばたと敵をかく乱する、純情少女。\n敵をスタンさせるスキルのほか、ユニオンバーストでは\n暗闇と混乱を付与することで敵を邪魔することができる。", /*only_disp_owned*/0, /*start_time*/"2019/03/19 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105601, /*unit_name*/"ルカ", /*kana*/"るか", /*prefab_id*/105601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/158, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/105601, /*cutin_2*/0, /*cutin1_star6*/105601, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で味方のため剣を振るう、いなせな姉御。\n相手へのカウンターも行う挑発や、敵の防御力を下げる\nユニオンバーストを持ち、攻防両面で実力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2018/11/03 19:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105701, /*unit_name*/"ジータ", /*kana*/"じーた", /*prefab_id*/105701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/245, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/105701, /*cutin_2*/0, /*cutin1_star6*/105701, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105801, /*unit_name*/"ペコリーヌ", /*kana*/"ぺこりーぬ", /*prefab_id*/105801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/155, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/105801, /*cutin_2*/0, /*cutin1_star6*/105801, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛にて、全力で仲間を護る、腹ペコ剣士。\n高いＨＰに加えて、自分自身でもＨＰ回復できるため\nギリギリまで味方の壁役を引き受ける。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/105901, /*unit_name*/"コッコロ", /*kana*/"こっころ", /*prefab_id*/105901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/500, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/105901, /*cutin_2*/0, /*cutin1_star6*/105901, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で、補助と攻撃で皆を支える、導きの巫女。\nユニオンバーストは、味方全体の攻撃力アップに加えて\n自らも回復するため、継続的なサポートが可能となる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/106001, /*unit_name*/"キャル", /*kana*/"きゃる", /*prefab_id*/106001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/750, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/106001, /*cutin_2*/0, /*cutin1_star6*/106001, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛から、強力な全体攻撃を放つ、強気な猫娘。\nスキルで敵の物理、魔法両方の防御力を下げるため\n編成を選ばずにバトルを有利に進められる。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/106101, /*unit_name*/"ムイミ", /*kana*/"むいみ", /*prefab_id*/106101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/162, /*atk_type*/1, /*normal_atk_cast_time*/1.8, /*cutin_1*/106101, /*cutin_2*/0, /*cutin1_star6*/106101, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、伝説の剣「天楼覇断剣」を振るう少女。\n小技を駆使する通常の戦闘スタイルから一転、ユニオン\nバースト後は「天楼覇断剣」を携え、敵を薙ぎ払う。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/106301, /*unit_name*/"アリサ", /*kana*/"ありさ", /*prefab_id*/106301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/625, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/106301, /*cutin_2*/0, /*cutin1_star6*/106301, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】後衛の、長期戦に優れた、森の守護者見習い。\nＴＰ回復によるユニオンバーストの速攻が可能。さらに\n使用後はスキル効果が上昇するため高い殲滅力を誇る。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/106401, /*unit_name*/"シェフィ", /*kana*/"しぇふぃ", /*prefab_id*/106401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/368, /*atk_type*/1, /*normal_atk_cast_time*/1.84, /*cutin_1*/106401, /*cutin_2*/0, /*cutin1_star6*/106401, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で氷雪を操り敵を凍滅する、氷竜の少女。\nユニオンバーストで獲得する【氷竜の印】を消費して、\nスキルの効果を増幅し、清廉な剣技で敵を切り伏せる。", /*only_disp_owned*/0, /*start_time*/"2021/02/15 23:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/106501, /*unit_name*/"カヤ", /*kana*/"かや", /*prefab_id*/106501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/168, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/106501, /*cutin_2*/0, /*cutin1_star6*/106501, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵を殴り倒す喧嘩屋ドラゴン族。\nスキルで自身の物理攻撃力を高め、全身全霊を懸け放つ\n初弾のユニオンバーストは、超大な破壊力を誇る。", /*only_disp_owned*/0, /*start_time*/"2019/11/15 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/106601, /*unit_name*/"イノリ", /*kana*/"いのり", /*prefab_id*/106601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/197, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/106601, /*cutin_2*/0, /*cutin1_star6*/106601, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"【物理】前衛で範囲攻撃が得意な口達者のドラゴン娘。\nユニオンバーストで範囲内の敵をまとめて吹き飛ばし、\n陣形を乱したところで、敵を一気に焼き尽くす。", /*only_disp_owned*/0, /*start_time*/"2020/06/17 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/106701, /*unit_name*/"ホマレ", /*kana*/"ホマレ", /*prefab_id*/106701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/0, /*motion_type*/3, /*se_type*/3, /*move_speed*/0, /*search_area_width*/0, /*atk_type*/0, /*normal_atk_cast_time*/0.0, /*cutin_1*/0, /*cutin_2*/0, /*cutin1_star6*/0, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/106801, /*unit_name*/"ラビリスタ", /*kana*/"らびりすた", /*prefab_id*/106801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/560, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/106801, /*cutin_2*/0, /*cutin1_star6*/106801, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】中衛で、万有を自在に創造する『迷宮女王』。\n七冠としての権能を解放するユニオンバーストで自身を\n極大に強化し比類ない攻撃能力で仇なす者を剿滅する。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/107001, /*unit_name*/"ネネカ", /*kana*/"ねねか", /*prefab_id*/107001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/660, /*atk_type*/2, /*normal_atk_cast_time*/2.0, /*cutin_1*/107001, /*cutin_2*/0, /*cutin1_star6*/107001, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛で、分身生成し敵を圧倒する『変貌大妃』。\n分身はネネカ自身と同じスキルをくり出し敵を攻撃する。\nその攻撃密度と制圧力の高さは他の追随を許さない。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/107101, /*unit_name*/"クリスティーナ", /*kana*/"くりすてぃーな", /*prefab_id*/107101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/10, /*se_type*/4, /*move_speed*/450, /*search_area_width*/290, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/107101, /*cutin_2*/0, /*cutin1_star6*/107101, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で、絶対的な制圧力を誇る『誓約女君』。\n攻防一体かつ超大な破壊力を誇るユニオンバーストと、\nその発動を加速するＴＰ上昇アップスキルを併せ持つ。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/107501, /*unit_name*/"ペコリーヌ（サマー）", /*kana*/"ぺこりーぬ", /*prefab_id*/107501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/235, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/107501, /*cutin_2*/0, /*cutin1_star6*/107501, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛から強烈な範囲攻撃を放つ、渚のお姫様。\nかき氷を食べて物理攻撃力を一気に上昇させ、\nユニオンバーストを放つことで前方の敵を殲滅する。", /*only_disp_owned*/0, /*start_time*/"2020/07/27 12:00:00", /*end_time*/"2020/07/31 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/107601, /*unit_name*/"コッコロ（サマー）", /*kana*/"こっころ", /*prefab_id*/107601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/535, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/107601, /*cutin_2*/0, /*cutin1_star6*/107601, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で、物理キャラの補助を行う癒しの巫女。\nＨＰが一番少ない味方単体への特大回復スキルを持ち、\n瀕死の味方ですら瞬時に治癒する。", /*only_disp_owned*/0, /*start_time*/"2020/06/19 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/107701, /*unit_name*/"スズメ（サマー）", /*kana*/"すずめ", /*prefab_id*/107701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/775, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/107701, /*cutin_2*/0, /*cutin1_star6*/107701, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【魔法】後衛の防衛能力に秀でた、夏のドジっ娘メイド。\n味方全体に防御力アップと継続ＨＰ回復をかけ、\nさらに壁になるゴーレムを呼んで、戦線を支える。", /*only_disp_owned*/0, /*start_time*/"2020/08/26 12:00:00", /*end_time*/"2020/08/31 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/107801, /*unit_name*/"キャル（サマー）", /*kana*/"きゃる", /*prefab_id*/107801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/780, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/107801, /*cutin_2*/0, /*cutin1_star6*/107801, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛から強力な単体攻撃を放つ真夏の猫娘。\nスキルで敵の魔法防御力を下げた上で、\n敵単体への魔法攻撃を繰り出し、大ダメージを与える。", /*only_disp_owned*/0, /*start_time*/"2020/07/27 12:00:00", /*end_time*/"2020/07/31 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/107901, /*unit_name*/"タマキ（サマー）", /*kana*/"たまき", /*prefab_id*/107901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/225, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/107901, /*cutin_2*/0, /*cutin1_star6*/107901, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛で連続攻撃を放つ、海辺の気まぐれ猫娘。\nランダムな相手への単体攻撃を計４度行う\nユニオンバーストは、対象がランダムだが威力は抜群。", /*only_disp_owned*/0, /*start_time*/"2020/08/26 12:00:00", /*end_time*/"2020/08/31 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108001, /*unit_name*/"ミフユ（サマー）", /*kana*/"みふゆ", /*prefab_id*/108001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/495, /*atk_type*/1, /*normal_atk_cast_time*/2.19, /*cutin_1*/108001, /*cutin_2*/0, /*cutin1_star6*/108001, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】中衛で、攻撃と補助の両方をこなす海の傭兵。\nユニオンバーストの効果で味方全体の物理攻撃力を高め、\n物理攻撃パーティの能力アップに一役買う。", /*only_disp_owned*/0, /*start_time*/"2020/07/20 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108101, /*unit_name*/"シノブ（ハロウィン）", /*kana*/"しのぶ", /*prefab_id*/108101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/440, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/108101, /*cutin_2*/0, /*cutin1_star6*/108101, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で、弱った敵を刈り取る幻夜の霊能少女。\n弱った敵単体に大ダメージを与えるユニオンバーストは\n対象を撃破時さらに敵全体に追加ダメージを与える。", /*only_disp_owned*/0, /*start_time*/"2020/10/26 15:00:00", /*end_time*/"2020/10/31 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108201, /*unit_name*/"ミヤコ（ハロウィン）", /*kana*/"みやこ", /*prefab_id*/108201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/590, /*atk_type*/1, /*normal_atk_cast_time*/2.42, /*cutin_1*/108201, /*cutin_2*/0, /*cutin1_star6*/108201, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛から、敵陣の後方を狙い撃つ幽霊狼少女。\n前方の相手を無視して妨害スキルやユニオンバーストを\n敵後方に放ち、特に防御力が低いキャラの脅威になる。", /*only_disp_owned*/0, /*start_time*/"2020/09/23 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108301, /*unit_name*/"ミサキ（ハロウィン）", /*kana*/"みさき", /*prefab_id*/108301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/815, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/108301, /*cutin_2*/0, /*cutin1_star6*/108301, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【魔法】後衛で、妨害スキルを操るオシャレ魔法少女。\n相手を誘惑状態にするスキルや、複数の状態異常を\n同時に付与するユニオンバーストで相手をかく乱する。", /*only_disp_owned*/0, /*start_time*/"2020/10/26 15:00:00", /*end_time*/"2020/10/31 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108401, /*unit_name*/"チカ（クリスマス）", /*kana*/"ちか", /*prefab_id*/108401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/770, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/108401, /*cutin_2*/0, /*cutin1_star6*/108401, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【魔法】後衛で、精霊を唱喚して戦う雪華の歌姫。\nユニオンバーストで呼び出す精霊たちはＨＰやＴＰを\n回復する能力を持ち、不利な戦況をも一変させる。", /*only_disp_owned*/0, /*start_time*/"2020/12/10 12:00:00", /*end_time*/"2020/12/21 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108501, /*unit_name*/"クルミ（クリスマス）", /*kana*/"くるみ", /*prefab_id*/108501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/295, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/108501, /*cutin_2*/0, /*cutin1_star6*/108501, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【物理】前衛から、ベルの音色で味方を守る小さな女優。\n攻撃を受けるまで周囲にいる味方の防御力を大きく高める\nスキルを持つ。活用できれば無類の耐久力を誇る。", /*only_disp_owned*/0, /*start_time*/"2020/11/24 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108601, /*unit_name*/"アヤネ（クリスマス）", /*kana*/"あやね", /*prefab_id*/108601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/190, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/108601, /*cutin_2*/0, /*cutin1_star6*/108601, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【物理】前衛で、敵をなぎ倒していく聖夜のくまっ子。\nユニオンバーストはＨＰを消費するが威力は絶大。\nスキルで物理攻撃力を上げ、さらにダメージアップ。", /*only_disp_owned*/0, /*start_time*/"2020/12/10 12:00:00", /*end_time*/"2020/12/21 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108701, /*unit_name*/"ヒヨリ（ニューイヤー）", /*kana*/"ひより", /*prefab_id*/108701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/170, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/108701, /*cutin_2*/0, /*cutin1_star6*/108701, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、物理火力を担う、振り袖姿の元気娘。\n物理攻撃キャラの攻撃力を上昇させるスキルを使う。\nさらに高い威力の単体ユニオンバーストの攻撃力は随一。", /*only_disp_owned*/0, /*start_time*/"2021/01/17 12:00:00", /*end_time*/"2021/01/22 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108801, /*unit_name*/"ユイ（ニューイヤー）", /*kana*/"ゆい", /*prefab_id*/108801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/745, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/108801, /*cutin_2*/0, /*cutin1_star6*/108801, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【魔法】後衛の、補助魔法に特化した、晴れ姿の癒し手。\n自身の攻撃力と引き換えに強力なバリアと継続回復状態を\n味方全体に付与する。絶大な防御能力は他を圧倒する。", /*only_disp_owned*/0, /*start_time*/"2021/01/17 12:00:00", /*end_time*/"2021/01/22 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/108901, /*unit_name*/"レイ（ニューイヤー）", /*kana*/"れい", /*prefab_id*/108901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/22, /*se_type*/4, /*move_speed*/450, /*search_area_width*/153, /*atk_type*/1, /*normal_atk_cast_time*/2.215, /*cutin_1*/108901, /*cutin_2*/0, /*cutin1_star6*/108901, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で、魔法攻撃から味方を守る、華麗な剣士。\nスキルで範囲内の味方に魔法無効バリアを展開し、\nさらにユニオンバーストで敵をスタンさせ攻撃を断つ。", /*only_disp_owned*/0, /*start_time*/"2020/12/22 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109001, /*unit_name*/"エリコ（バレンタイン）", /*kana*/"えりこ", /*prefab_id*/109001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/187, /*atk_type*/1, /*normal_atk_cast_time*/1.9, /*cutin_1*/109001, /*cutin_2*/0, /*cutin1_star6*/109001, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【物理】前衛で、ピンチをチャンスに変える愛の壊し屋。\nスキルはＨＰを消費し、自身の攻撃力を高める。また、\nユニオンバーストはＨＰが低いほど超絶威力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2021/01/25 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109101, /*unit_name*/"シズル（バレンタイン）", /*kana*/"しずる", /*prefab_id*/109101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/385, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/109101, /*cutin_2*/0, /*cutin1_star6*/109101, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】中衛で皆を助けるパティシエールのお姉ちゃん。\n複数のパラメータが同時に上昇するフィールドを展開し、\nさらに効果時間中はスキル効果が大幅に強化される。", /*only_disp_owned*/0, /*start_time*/"2021/02/10 12:00:00", /*end_time*/"2021/02/15 22:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109201, /*unit_name*/"アン", /*kana*/"あん", /*prefab_id*/109201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/23, /*se_type*/7, /*move_speed*/450, /*search_area_width*/630, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/109201, /*cutin_2*/0, /*cutin1_star6*/109201, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【魔法】後衛で、英霊の召喚術を武器に戦うお姫様。\n味方に英霊の加護を付与するスキルによるサポーターと、\n高威力の魔法によるアタッカーの二つの役割を併せ持つ。", /*only_disp_owned*/0, /*start_time*/"2019/03/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109301, /*unit_name*/"ルゥ", /*kana*/"るぅ", /*prefab_id*/109301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/23, /*se_type*/7, /*move_speed*/450, /*search_area_width*/640, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/109301, /*cutin_2*/0, /*cutin1_star6*/109301, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛で、オメメちゃんと戦う、ノーテンキ少女。\nスキルで呼び出すオメメちゃんは敵の攻撃を防ぐほか、\nその数が多いほどユニオンバーストの威力を増加させる。", /*only_disp_owned*/0, /*start_time*/"2021/03/23 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109401, /*unit_name*/"グレア", /*kana*/"ぐれあ", /*prefab_id*/109401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/525, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/109401, /*cutin_2*/0, /*cutin1_star6*/109401, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】中衛で、炎を操り敵を薙ぎ払う、竜人の少女。\n高い魔法攻撃力を生かした範囲攻撃を得意とする。\nまた、飛行能力を駆使して放つ突進攻撃も強力。", /*only_disp_owned*/0, /*start_time*/"2019/04/19 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109501, /*unit_name*/"クウカ（オーエド）", /*kana*/"くうか", /*prefab_id*/109501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/2, /*se_type*/7, /*move_speed*/450, /*search_area_width*/140, /*atk_type*/2, /*normal_atk_cast_time*/2.066, /*cutin_1*/109501, /*cutin_2*/0, /*cutin1_star6*/109501, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】最前衛で、味方を鼓舞する着物姿のドＭ娘。\n味方の魔法攻撃力を高め、敵の魔法防御力を下げる事で、\n魔法パーティのサポート兼防御役として活躍する。", /*only_disp_owned*/0, /*start_time*/"2019/04/30 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109601, /*unit_name*/"ニノン（オーエド）", /*kana*/"にのん", /*prefab_id*/109601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/175, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/109601, /*cutin_2*/0, /*cutin1_star6*/109601, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】最前衛で、忍法を駆使して敵と戦うクノイチ。\nユニオンバーストはクリティカル時のダメージを１．５倍\nにする特性を持ち、うまくかみ合った時の威力は抜群。", /*only_disp_owned*/0, /*start_time*/"2019/05/17 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109701, /*unit_name*/"レム", /*kana*/"れむ", /*prefab_id*/109701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/24, /*se_type*/13, /*move_speed*/450, /*search_area_width*/540, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/109701, /*cutin_2*/0, /*cutin1_star6*/109701, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【物理】中衛で、鬼の力で敵を粉砕する、双子の妹。\n回復スキルの他にも、温度を操るスキルを得意とし、\n敵を凍結させた上でユニオンバーストで薙ぎ払う。", /*only_disp_owned*/0, /*start_time*/"2020/11/10 12:00:00", /*end_time*/"2020/11/21 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109801, /*unit_name*/"ラム", /*kana*/"らむ", /*prefab_id*/109801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/24, /*se_type*/7, /*move_speed*/450, /*search_area_width*/545, /*atk_type*/2, /*normal_atk_cast_time*/2.5, /*cutin_1*/109801, /*cutin_2*/0, /*cutin1_star6*/109801, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】中衛で、特殊能力で味方を補助する、双子の姉。\n相手の物理攻撃を見切って回避させる「千里眼」や、\n敵全体を束縛するユニオンバーストの補助は効果絶大。", /*only_disp_owned*/1, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/109901, /*unit_name*/"エミリア", /*kana*/"えみりあ", /*prefab_id*/109901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/23, /*se_type*/7, /*move_speed*/450, /*search_area_width*/725, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/109901, /*cutin_2*/0, /*cutin1_star6*/109901, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛で、攻撃と回復をこなす、ハーフエルフ。\n高い魔力で攻撃魔法を繰り出して敵を蹴散らしつつ、\nユニオンバーストは瀕死の味方すらも瞬時に癒す。", /*only_disp_owned*/0, /*start_time*/"2020/11/10 12:00:00", /*end_time*/"2020/11/21 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110001, /*unit_name*/"スズナ（サマー）", /*kana*/"すずな", /*prefab_id*/110001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/705, /*atk_type*/1, /*normal_atk_cast_time*/1.82, /*cutin_1*/110001, /*cutin_2*/0, /*cutin1_star6*/110001, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【物理】後衛で高威力の弓技を放つ夏のカリスマモデル。\nバトル中に一度だけ放つ「サマーランウェイ♪」でＴＰを\n全回復し、以降ユニオンバーストがクリティカルになる。", /*only_disp_owned*/0, /*start_time*/"2020/06/10 12:00:00", /*end_time*/"2020/06/17 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110101, /*unit_name*/"イオ（サマー）", /*kana*/"いお", /*prefab_id*/110101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/715, /*atk_type*/2, /*normal_atk_cast_time*/2.4, /*cutin_1*/110101, /*cutin_2*/0, /*cutin1_star6*/110101, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【魔法】後衛で、敵の体力を奪い取る、夏の夜の先生。\nダメージを与えつつ味方を回復するスキルを複数持ち、\n攻守どちらの側でも高い能力を発揮する。", /*only_disp_owned*/1, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110201, /*unit_name*/"ミサキ（サマー）", /*kana*/"みさき", /*prefab_id*/110201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/0, /*search_area_width*/0, /*atk_type*/0, /*normal_atk_cast_time*/0.0, /*cutin_1*/0, /*cutin_2*/0, /*cutin1_star6*/0, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110301, /*unit_name*/"サレン（サマー）", /*kana*/"されん", /*prefab_id*/110301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/585, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/110301, /*cutin_2*/0, /*cutin1_star6*/110301, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】中衛で、味方の速攻を支える海辺のサレンママ。\nバトル開始時に味方全体のＴＰを一気に溜めることで、\n迅速にユニオンバーストを発動させることを可能にする。", /*only_disp_owned*/0, /*start_time*/"2020/06/10 12:00:00", /*end_time*/"2020/06/17 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110401, /*unit_name*/"マコト（サマー）", /*kana*/"まこと", /*prefab_id*/110401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/180, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/110401, /*cutin_2*/0, /*cutin1_star6*/110401, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で攻撃対象が１つの敵に特化した海の狼娘。\n攻撃対象が１つの場合、スキルとユニオンバーストともに\n真価を発揮し他を圧倒する絶大な破壊力で敵をなぎ払う。", /*only_disp_owned*/0, /*start_time*/"2020/07/10 12:00:00", /*end_time*/"2020/07/15 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110501, /*unit_name*/"カオリ（サマー）", /*kana*/"かおり", /*prefab_id*/110501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/425, /*atk_type*/1, /*normal_atk_cast_time*/2.42, /*cutin_1*/110501, /*cutin_2*/0, /*cutin1_star6*/110501, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】中衛で、敵をまとめてなぎ倒す、真夏の南国娘。\n吹き飛ばし効果を持つスキルで敵をまとめ、攻撃対象が\n多い程、威力が増すユニオンバーストで敵をなぎ倒す。", /*only_disp_owned*/1, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110601, /*unit_name*/"マホ（サマー）", /*kana*/"まほ", /*prefab_id*/110601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/792, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/110601, /*cutin_2*/0, /*cutin1_star6*/110601, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【魔法】後衛で、膨大な魔力を振るう、真夏のおとぎ姫。\n高火力で対象がランダムなスキルやユニオンバーストは、\n攻撃対象が１つの敵に対して絶大なダメージを叩き出す。", /*only_disp_owned*/0, /*start_time*/"2020/07/10 12:00:00", /*end_time*/"2020/07/15 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110701, /*unit_name*/"アオイ（編入生）", /*kana*/"あおい", /*prefab_id*/110701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/680, /*atk_type*/1, /*normal_atk_cast_time*/1.82, /*cutin_1*/110701, /*cutin_2*/0, /*cutin1_star6*/110701, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】後衛で毒を操る、ぼっちエルフの編入生。\n敵が毒や猛毒になっていると強化される攻撃スキルと、\n敵の物理防御力を下げるスキルで味方をサポートする。", /*only_disp_owned*/0, /*start_time*/"2019/09/03 21:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110801, /*unit_name*/"クロエ", /*kana*/"くろえ", /*prefab_id*/110801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/185, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/110801, /*cutin_2*/0, /*cutin1_star6*/110801, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で、手数で圧倒する、ダウナー系エルフ。\n攻撃するたびに相手に【畏縮】ステータスを追加し、\nスキルのダメージと物理防御力ダウンに磨きをかける。", /*only_disp_owned*/0, /*start_time*/"2019/09/16 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/110901, /*unit_name*/"チエル", /*kana*/"ちえる", /*prefab_id*/110901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/222, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/110901, /*cutin_2*/0, /*cutin1_star6*/110901, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛でパンチを放つちぇる盛りＭＡＸな女の子。\nクリティカルを出すたびに【ちぇる】を溜め、自己を強化\nし続け、後半になるほど敵をちぇるっとじぇのさいする。", /*only_disp_owned*/0, /*start_time*/"2020/04/15 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111001, /*unit_name*/"ユニ", /*kana*/"ゆに", /*prefab_id*/111001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/26, /*se_type*/7, /*move_speed*/450, /*search_area_width*/807, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/111001, /*cutin_2*/0, /*cutin1_star6*/111001, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【魔法】後衛で、味方の支援に特化した象牙の塔の才媛。\n自身の攻撃力は低いが、物理攻撃力の高い味方を強化し\n更に味方全体を魔法無効バリアで護りつつ勝利へ導く。", /*only_disp_owned*/0, /*start_time*/"2020/03/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111101, /*unit_name*/"キョウカ（ハロウィン）", /*kana*/"きょうか", /*prefab_id*/111101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/820, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/111101, /*cutin_2*/0, /*cutin1_star6*/111101, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【魔法】後衛で味方の火力を高める、黒猫仮装の優等生。\n自分の魔法攻撃力に応じて効果が強化されるものと、\n効果が累積するもの等、多彩なスキルで攻撃力を高める。", /*only_disp_owned*/0, /*start_time*/"2020/09/14 12:00:00", /*end_time*/"2020/09/19 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111201, /*unit_name*/"ミソギ（ハロウィン）", /*kana*/"みそぎ", /*prefab_id*/111201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/212, /*atk_type*/1, /*normal_atk_cast_time*/2.17, /*cutin_1*/111201, /*cutin_2*/0, /*cutin1_star6*/111201, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】前衛で範囲攻撃を放つ、カボチャ衣装の悪戯娘。敵に５カウントで爆発する爆弾を仕掛けたり、カボチャの手榴弾を投げつけたりと、様々な範囲攻撃で敵を弄ぶ。", /*only_disp_owned*/1, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111301, /*unit_name*/"ミミ（ハロウィン）", /*kana*/"みみ", /*prefab_id*/111301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/365, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/111301, /*cutin_2*/0, /*cutin1_star6*/111301, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】中衛の、攻撃に特化した、ぐるぐるうさぎっこ。\n行動頻度は少ないが、高威力の範囲攻撃を放ち、\n味方全体の物理攻撃力を大きく高めるスキルも効果抜群。", /*only_disp_owned*/0, /*start_time*/"2019/10/16 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111401, /*unit_name*/"ルナ", /*kana*/"るな", /*prefab_id*/111401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/25, /*se_type*/7, /*move_speed*/450, /*search_area_width*/765, /*atk_type*/2, /*normal_atk_cast_time*/1.87, /*cutin_1*/111401, /*cutin_2*/0, /*cutin1_star6*/111401, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、死霊術でおともだちを作る可憐な少女。\nルナがダメージを与える度に集まってくるおともだちを、\n各スキルで消費する。消費数に応じ強大な力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2019/10/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111501, /*unit_name*/"クリスティーナ（クリスマス）", /*kana*/"くりすてぃーな", /*prefab_id*/111501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/10, /*se_type*/4, /*move_speed*/450, /*search_area_width*/265, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/111501, /*cutin_2*/0, /*cutin1_star6*/111501, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】前衛で戦いを愉しむ、聖夜の『誓約女君』。\nユニオンバーストを使用すると得られるコインの有無で、\n補助と攻撃の二役を切り替え、華麗に敵を斬り倒す。", /*only_disp_owned*/0, /*start_time*/"2020/12/10 12:00:00", /*end_time*/"2020/12/21 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111601, /*unit_name*/"ノゾミ（クリスマス）", /*kana*/"のぞみ", /*prefab_id*/111601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/418, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/111601, /*cutin_2*/0, /*cutin1_star6*/111601, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】中衛でパーティの守りを支えるサンタアイドル。\nスキルで物理攻撃を無効化し、後方の味方が多いほど\n物理防御力を高めるユニオンバーストで生存力を高める。", /*only_disp_owned*/1, /*start_time*/"2019/11/30 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111701, /*unit_name*/"イリヤ（クリスマス）", /*kana*/"いりや", /*prefab_id*/111701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/255, /*atk_type*/2, /*normal_atk_cast_time*/1.3, /*cutin_1*/111701, /*cutin_2*/0, /*cutin1_star6*/111701, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【魔法】前衛で、血を対価に敵を攻撃する聖夜の吸血鬼。\n残りＨＰが低い程ダメージが上昇するスキルと、ＨＰを\n消費するスキルを組み合わせ、絶大な破壊力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2019/12/20 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111801, /*unit_name*/"ペコリーヌ（ニューイヤー）", /*kana*/"ぺこりーぬ", /*prefab_id*/111801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/22, /*se_type*/4, /*move_speed*/450, /*search_area_width*/248, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/111801, /*cutin_2*/0, /*cutin1_star6*/111801, /*cutin2_star6*/0, /*guild_id*/13, /*exskill_display*/0, /*comment*/"【物理】前衛で元気いっぱいに新年を祝う腹ペコお姫様。\n物理攻撃力を高めるスキルで味方を強化し、ＨＰが多い\nほどダメージが上昇するユニオンバーストで敵を討つ。", /*only_disp_owned*/0, /*start_time*/"2021/01/03 19:00:00", /*end_time*/"2021/01/12 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/111901, /*unit_name*/"コッコロ（ニューイヤー）", /*kana*/"こっころ", /*prefab_id*/111901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/23, /*se_type*/7, /*move_speed*/450, /*search_area_width*/159, /*atk_type*/1, /*normal_atk_cast_time*/1.87, /*cutin_1*/111901, /*cutin_2*/0, /*cutin1_star6*/111901, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛で、味方の補助に秀でた、新風の巫女。\n物理クリティカル時のダメージアップのスキルで味方の\n殲滅力を高めつつ、挑発や継続回復で耐久面を支える。", /*only_disp_owned*/0, /*start_time*/"2021/01/12 12:00:00", /*end_time*/"2021/01/17 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112001, /*unit_name*/"キャル（ニューイヤー）", /*kana*/"きゃる", /*prefab_id*/112001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/690, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/112001, /*cutin_2*/0, /*cutin1_star6*/112001, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【魔法】後衛で、攻防双方で活躍する晴れ着姿の猫娘。\n与ダメージに応じて魔法攻撃力がアップするユニオン\nバーストで、高いベースの攻撃力がさらに強大になる。", /*only_disp_owned*/0, /*start_time*/"2021/01/12 12:00:00", /*end_time*/"2021/01/17 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112101, /*unit_name*/"スズメ（ニューイヤー）", /*kana*/"すずめ", /*prefab_id*/112101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/722, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/112101, /*cutin_2*/0, /*cutin1_star6*/112101, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛で祈りによるサポートを行うドジっ娘巫女。\nスキルの魔法無効バリアで耐久力を高め、ユニオン\nバーストでＨＰ回復と行動速度アップで戦況を整える。", /*only_disp_owned*/1, /*start_time*/"2019/12/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112201, /*unit_name*/"カスミ（マジカル）", /*kana*/"かすみ", /*prefab_id*/112201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/730, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/112201, /*cutin_2*/0, /*cutin1_star6*/112201, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛の、妨害に特化した能力を持つ魔法探偵。\n相手のＴＰを大きく減少させるスキルや、遠くの敵を\n束縛するスキルを操り、相手の連携を大きく乱す。", /*only_disp_owned*/0, /*start_time*/"2020/01/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112301, /*unit_name*/"シオリ（マジカル）", /*kana*/"しおり", /*prefab_id*/112301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/712, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/112301, /*cutin_2*/0, /*cutin1_star6*/112301, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】後衛で味方の火力の底上げを担う魔法狩人。\nユニオンバーストで味方全体の物理攻撃力を大きく高め\nスキルは範囲内の物理攻撃力を高め、輝矢の一撃を放つ。", /*only_disp_owned*/1, /*start_time*/"2020/01/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112401, /*unit_name*/"ウヅキ（デレマス）", /*kana*/"うづき", /*prefab_id*/112401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/370, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/112401, /*cutin_2*/0, /*cutin1_star6*/112401, /*cutin2_star6*/0, /*guild_id*/18, /*exskill_display*/0, /*comment*/"【物理】中衛で、味方を鼓舞して戦う、キュートな少女。\n味方をＴＰや攻撃力をアップさせるスキルでサポートし、\n自身も強力な範囲攻撃で敵をなぎ払う。", /*only_disp_owned*/0, /*start_time*/"2021/03/08 12:00:00", /*end_time*/"2021/03/24 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112501, /*unit_name*/"リン（デレマス）", /*kana*/"りんでれます", /*prefab_id*/112501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/153, /*atk_type*/1, /*normal_atk_cast_time*/2.215, /*cutin_1*/112501, /*cutin_2*/0, /*cutin1_star6*/112501, /*cutin2_star6*/0, /*guild_id*/18, /*exskill_display*/0, /*comment*/"【物理】前衛で、氷を創出し味方を護る、クールな少女。\n目の前の敵を束縛するスキルや挑発で行動を妨害し、\n自身にもバリアを展開し、鉄壁の防御能力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2021/03/08 12:00:00", /*end_time*/"2021/03/24 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112601, /*unit_name*/"ミオ（デレマス）", /*kana*/"みお", /*prefab_id*/112601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/695, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/112601, /*cutin_2*/0, /*cutin1_star6*/112601, /*cutin2_star6*/0, /*guild_id*/18, /*exskill_display*/0, /*comment*/"【魔法】後衛で攻防共に活躍するパッション溢れる少女。\nダメージを受けた味方中心に回復魔法で補助をし、\nさらに魔法攻撃を仕掛けて、敵を一網打尽にする。", /*only_disp_owned*/1, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112701, /*unit_name*/"リン（レンジャー）", /*kana*/"りん", /*prefab_id*/112701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/422, /*atk_type*/1, /*normal_atk_cast_time*/2.19, /*cutin_1*/112701, /*cutin_2*/0, /*cutin1_star6*/112701, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】中衛から、敵の守りを貫くドングリレンジャー。\n戦闘開始と共に範囲内の敵の物理防御力を大幅に下げ、\n序盤から大ダメージを与えられる戦況を作り出す。", /*only_disp_owned*/0, /*start_time*/"2020/04/30 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112801, /*unit_name*/"マヒル（レンジャー）", /*kana*/"まひる", /*prefab_id*/112801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/390, /*atk_type*/1, /*normal_atk_cast_time*/2.19, /*cutin_1*/112801, /*cutin_2*/0, /*cutin1_star6*/112801, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】中衛で、多勢相手が十八番のまきばの戦士。\n相手を吹き飛ばすスキルを多用し敵の陣形を押し込む。\n範囲攻撃と混乱付与スキルを駆使し一気に殲滅する。", /*only_disp_owned*/0, /*start_time*/"2020/05/15 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/112901, /*unit_name*/"リノ（ワンダー）", /*kana*/"りの", /*prefab_id*/112901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/730, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/112901, /*cutin_2*/0, /*cutin1_star6*/112901, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】後衛で、希望の力で戦う、不思議の国の救世主。\nクリティカルすると効果アップのスキルや味方の数が多い\n程、威力がアップするユニオンバーストで敵を殲滅する。", /*only_disp_owned*/0, /*start_time*/"2020/06/03 19:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113001, /*unit_name*/"アユミ（ワンダー）", /*kana*/"あゆみ", /*prefab_id*/113001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/508, /*atk_type*/1, /*normal_atk_cast_time*/2.34, /*cutin_1*/113001, /*cutin_2*/0, /*cutin1_star6*/113001, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、戦場の動向を自在に操る白兎の乙女。\n敵の行動速度をダウンさせ、味方の速度をアップさせる\nスキルと敵の時を止めるスキルで、常に味方を支える。", /*only_disp_owned*/1, /*start_time*/"2020/05/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113101, /*unit_name*/"ルカ（サマー）", /*kana*/"るか", /*prefab_id*/113101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/27, /*se_type*/27, /*move_speed*/450, /*search_area_width*/192, /*atk_type*/1, /*normal_atk_cast_time*/1.3, /*cutin_1*/113101, /*cutin_2*/0, /*cutin1_star6*/113101, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】前衛で、流麗な太刀捌きを魅せる若夏の姉御。\nダメージを与えた回数に応じて攻撃力が高まるスキルと、\n携えた二刀の幾刃もの斬撃で、眼前の敵を薙ぎ払う。", /*only_disp_owned*/0, /*start_time*/"2021/02/23 15:00:00", /*end_time*/"2021/02/28 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113201, /*unit_name*/"アンナ（サマー）", /*kana*/"あんな", /*prefab_id*/113201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/28, /*se_type*/5, /*move_speed*/450, /*search_area_width*/256, /*atk_type*/2, /*normal_atk_cast_time*/1.625, /*cutin_1*/113201, /*cutin_2*/0, /*cutin1_star6*/113201, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】前衛で皆の力を借り受け力を振るう真夏の冥姫。\n味方全体の魔法攻撃力を代償に自身の魔法攻撃力を劇的に\n高め、熾烈な攻撃魔法を繰り出し大ダメージを与える。", /*only_disp_owned*/1, /*start_time*/"2020/06/30 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113301, /*unit_name*/"ナナカ（サマー）", /*kana*/"ななか", /*prefab_id*/113301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/468, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/113301, /*cutin_2*/0, /*cutin1_star6*/113301, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】中衛の多勢相手の戦いが得意な真夏の魔法少女。\n敵の数に応じて効果が上昇する防御力ダウンのスキルや、\n多彩な範囲攻撃を操り、真夏の戦いをサイカワに制する。", /*only_disp_owned*/0, /*start_time*/"2020/07/15 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113401, /*unit_name*/"ハツネ（サマー）", /*kana*/"はつね", /*prefab_id*/113401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/29, /*se_type*/7, /*move_speed*/450, /*search_area_width*/567, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/113401, /*cutin_2*/0, /*cutin1_star6*/113401, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】中衛から全体魔法攻撃を放つ超能力チアガール。\nユニオンバーストで敵全体に絶大な一撃を放ち、\nその後、超能力発動の反動で枕を抱えて夢の中へ。", /*only_disp_owned*/0, /*start_time*/"2021/03/12 12:00:00", /*end_time*/"2021/03/22 14:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113501, /*unit_name*/"ミサト（サマー）", /*kana*/"みさと", /*prefab_id*/113501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/697, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/113501, /*cutin_2*/0, /*cutin1_star6*/113501, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】後衛で、敵の脅威から生徒を守る夏女神な先生。\n味方の魔法防御力を高め、ＨＰを継続回復するスキルや、\nバリア展開のユニオンバーストで味方を堅固に守護する。", /*only_disp_owned*/1, /*start_time*/"2020/07/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113601, /*unit_name*/"ジュン（サマー）", /*kana*/"じゅん", /*prefab_id*/113601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/182, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/113601, /*cutin_2*/0, /*cutin1_star6*/113601, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】前衛で、業火を従え悪を討つ真夏の騎士団長。\n敵単体にダメージを与えつつ、攻撃力を高めるユニオン\nバーストや、火傷を与えるスキルを操り敵を焼き尽くす。", /*only_disp_owned*/0, /*start_time*/"2020/08/15 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113701, /*unit_name*/"アカリ（エンジェル）", /*kana*/"あかり", /*prefab_id*/113701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/530, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/113701, /*cutin_2*/0, /*cutin1_star6*/113701, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】中衛で、魔法攻撃をお見舞いする双子の妹天使。\n効果時間が短い分、絶大な効果の強化魔法で自身の攻撃力\nを大きく高め、威力抜群の単体魔法で敵を一掃する。", /*only_disp_owned*/0, /*start_time*/"2020/09/03 19:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113801, /*unit_name*/"ヨリ（エンジェル）", /*kana*/"より", /*prefab_id*/113801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/531, /*atk_type*/2, /*normal_atk_cast_time*/2.34, /*cutin_1*/113801, /*cutin_2*/0, /*cutin1_star6*/113801, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】中衛で、補助魔法で味方を助ける双子の姉天使。\n防御力を大幅に高めつつ、対象の味方に敵の注意を引か\nせるなど、特殊で強力なスキルを駆使し敵を翻弄する。", /*only_disp_owned*/0, /*start_time*/"2020/09/19 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/113901, /*unit_name*/"ツムギ（ハロウィン）", /*kana*/"つむぎ", /*prefab_id*/113901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/152, /*atk_type*/1, /*normal_atk_cast_time*/2.375, /*cutin_1*/113901, /*cutin_2*/0, /*cutin1_star6*/113901, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】前衛で敵の物理攻撃を妨害する吸血鬼テーラー。\n挑発と物理無効バリア、さらに最も物理攻撃力が高い敵を\n狙った妨害スキルによって、鉄壁の防御を織り上げる。", /*only_disp_owned*/0, /*start_time*/"2021/04/22 12:00:00", /*end_time*/"2021/04/28 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/114001, /*unit_name*/"レイ（ハロウィン）", /*kana*/"れい", /*prefab_id*/114001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/375, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/114001, /*cutin_2*/0, /*cutin1_star6*/114001, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、手負いの敵を死に誘う、幽雅の剣士。\nＨＰが50％未満の敵に対し放つと、威力が大アップする\n範囲攻撃を繰り出し負傷した敵の戦意を一気に叩き折る。", /*only_disp_owned*/0, /*start_time*/"2020/10/15 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/114101, /*unit_name*/"マツリ（ハロウィン）", /*kana*/"まつり", /*prefab_id*/114101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/186, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/114101, /*cutin_2*/0, /*cutin1_star6*/114101, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】前衛で鋭爪を突き立てるハロウィン騎士見習い。\nユニオンバーストの使用回数に応じて強化されるスキルで\n与えるダメージと行動速度をアップさせ、敵を斬り裂く。", /*only_disp_owned*/1, /*start_time*/"2020/09/30 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/114201, /*unit_name*/"モニカ（マジカル）", /*kana*/"もにか", /*prefab_id*/114201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/528, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/114201, /*cutin_2*/0, /*cutin1_star6*/114201, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で愛と希望の力を胸に指揮を執る魔法提督。\nユニオンバーストで敵単体の物理防御力を下げ、範囲内の\n味方の物理攻撃力アップスキルで、一気に戦況を決める。", /*only_disp_owned*/0, /*start_time*/"2020/10/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/114301, /*unit_name*/"トモ（マジカル）", /*kana*/"とも", /*prefab_id*/114301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/402, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/114301, /*cutin_2*/0, /*cutin1_star6*/114301, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】中衛で正義の力を魔法にのせて戦う魔法剣士。\n自身の物理攻撃力を魔法攻撃力に加える魔法少女の力と、\nたゆまぬ努力で獲得した剣技で、華麗な魔法攻撃を放つ。", /*only_disp_owned*/0, /*start_time*/"2020/11/21 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/114401, /*unit_name*/"アキノ（クリスマス）", /*kana*/"あきの", /*prefab_id*/114401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/189, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/114401, /*cutin_2*/0, /*cutin1_star6*/114401, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で味方のサポートを力に戦う、聖夜の令嬢。\nステータスアップ効果を受けると増加する【聖夜の煌き】\nでスキルを大きく強化し、聖夜を彩る強烈な一撃を放つ。", /*only_disp_owned*/0, /*start_time*/"2020/11/30 12:00:00", /*end_time*/"2020/12/10 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/114501, /*unit_name*/"サレン（クリスマス）", /*kana*/"されん", /*prefab_id*/114501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/150, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/114501, /*cutin_2*/0, /*cutin1_star6*/114501, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】前衛で、光を操り味方を守る聖夜のサレンママ。\n敵の攻撃を防ぎ、ダメージを与えるユニオンバーストや、\nダメージを与えつつ回復するスキルで、攻守双方を担う。", /*only_disp_owned*/0, /*start_time*/"2020/12/21 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/114601, /*unit_name*/"ユカリ（クリスマス）", /*kana*/"ゆかり", /*prefab_id*/114601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/408, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/114601, /*cutin_2*/0, /*cutin1_star6*/114601, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】中衛で物理キャラを支援し戦う聖夜の元聖騎士。\n魔法攻撃力の高い敵単体のＴＰ減少や周囲の味方の魔法\n防御力アップスキルで、対魔法戦で無類の輝きを放つ。", /*only_disp_owned*/1, /*start_time*/"2020/11/30 12:00:00", /*end_time*/"2020/12/10 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/114701, /*unit_name*/"ムイミ（ニューイヤー）", /*kana*/"むいみ", /*prefab_id*/114701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/31, /*se_type*/2, /*move_speed*/450, /*search_area_width*/138, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/114701, /*cutin_2*/0, /*cutin1_star6*/114701, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で、新風纏う「天楼覇断剣」を振るう少女。\n皆より一足遅れて突撃し、敵の前衛を吹き飛ばした後、\n強化した範囲物理攻撃で、ダンゴになった敵を斬り払う。", /*only_disp_owned*/1, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/115001, /*unit_name*/"ネネカ（ニューイヤー）", /*kana*/"ねねか", /*prefab_id*/115001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/562, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/115001, /*cutin_2*/0, /*cutin1_star6*/115001, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【魔法】中衛で艶やかな晴れ着を身に纏う『変貌大妃』。\n味方の魔法攻撃力アップやＨＰ、ＴＰを回復させるスキル\nで攻守にわたってサポートし苛烈な戦況でも勝利に導く。", /*only_disp_owned*/0, /*start_time*/"2021/01/22 15:00:00", /*end_time*/"2021/01/31 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/115501, /*unit_name*/"コッコロ（儀装束）", /*kana*/"こっころ", /*prefab_id*/115501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/533, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/115501, /*cutin_2*/0, /*cutin1_star6*/115501, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で、尊き儀装束を纏うエルフの里の巫女。\n自分の攻撃力を強化し、さらにＴＰ回復で攻撃の手数を\n増やす。クリティカル時の猛攻で仲間を守る剣となる。", /*only_disp_owned*/0, /*start_time*/"2021/01/31 12:00:00", /*end_time*/"2021/02/10 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/115601, /*unit_name*/"ユイ（儀装束）", /*kana*/"ゆい", /*prefab_id*/115601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/578, /*atk_type*/2, /*normal_atk_cast_time*/1.97, /*cutin_1*/115601, /*cutin_2*/0, /*cutin1_star6*/115601, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【魔法】中衛で精霊術を操り味方を支える儀装の魔法士。\n複数の物理攻撃力の強化スキルで味方を攻撃支援しつつ\n強力な回復スキルで、前線を整えバトルを掌握する。", /*only_disp_owned*/1, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2021/01/10 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/115701, /*unit_name*/"カスミ（サマー）", /*kana*/"かすみ", /*prefab_id*/115701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/738, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/115701, /*cutin_2*/0, /*cutin1_star6*/115701, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛で、敵の防御力を削ぎ取る渚の名探偵。\n攻撃力が高い敵に目標を定めて防御力を下げつつ、\n味方を強化するスキルで、どんな難事件も解決へと導く。", /*only_disp_owned*/0, /*start_time*/"2021/02/23 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/115801, /*unit_name*/"リマ（シンデレラ）", /*kana*/"りま", /*prefab_id*/115801, /*prefab_id_battle*/116101, /*is_limited*/1, /*rarity*/1, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/173, /*atk_type*/1, /*normal_atk_cast_time*/2.27, /*cutin_1*/115801, /*cutin_2*/0, /*cutin1_star6*/115801, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】前衛の魔法の果実でお姫様姿になった恋乙女。\n獣の姿からユニオンバーストで一定時間、人の姿に変身し\n味方全体の攻撃力アップスキルで、火力の底上げをする。", /*only_disp_owned*/1, /*start_time*/"2021/02/28 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/115901, /*unit_name*/"マコト（シンデレラ）", /*kana*/"まこと", /*prefab_id*/115901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/166, /*atk_type*/1, /*normal_atk_cast_time*/2.27, /*cutin_1*/115901, /*cutin_2*/0, /*cutin1_star6*/115901, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で、華装に身を包み流麗な剣舞を舞う狼娘。\n周囲の味方の数に応じて、スキルの威力と物理攻撃力\nアップのスキル効果が上がり、鼓舞激励の一斬を振るう。", /*only_disp_owned*/0, /*start_time*/"2021/03/03 19:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/116001, /*unit_name*/"マホ（シンデレラ）", /*kana*/"まほ", /*prefab_id*/116001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/645, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/116001, /*cutin_2*/0, /*cutin1_star6*/116001, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛から、優雅に味方を支援するマホ先生。\n物理攻撃をする味方の攻撃力アップや、最遠の味方のＴＰ\nを回復するスキルで、しゃなりしゃなりと戦況を変える。", /*only_disp_owned*/0, /*start_time*/"2021/03/22 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/116201, /*unit_name*/"クロエ（聖学祭）", /*kana*/"くろえ", /*prefab_id*/116201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/184, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/116201, /*cutin_2*/0, /*cutin1_star6*/116201, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で疾風の如く駆け抜ける、ダウナー女子。\n49回ダメージを与えるたび自分のＴＰ全回復のスキルと\n発動ごとに攻撃力アップのスキルで勝利のテープを掴む。", /*only_disp_owned*/0, /*start_time*/"2021/04/15 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/116301, /*unit_name*/"チエル（聖学祭）", /*kana*/"ちえる", /*prefab_id*/116301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/32, /*se_type*/1, /*move_speed*/450, /*search_area_width*/223, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/116301, /*cutin_2*/0, /*cutin1_star6*/116301, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で聖学祭を盛りアゲる、はぴちぇる系女子。\n攻撃ヒットのたびに【ちぇる】を貯め、威力が増すスキル\nと味方全体の物理攻撃力アップ効果のＵＢで勝利に導く。", /*only_disp_owned*/0, /*start_time*/"2021/03/31 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/116401, /*unit_name*/"ユニ（聖学祭）", /*kana*/"ゆに", /*prefab_id*/116401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/0, /*search_area_width*/0, /*atk_type*/0, /*normal_atk_cast_time*/0.0, /*cutin_1*/0, /*cutin_2*/0, /*cutin1_star6*/0, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/116501, /*unit_name*/"イノリ（タイムトラベル）", /*kana*/"いのり", /*prefab_id*/116501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/252, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/116501, /*cutin_2*/0, /*cutin1_star6*/116501, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"【物理】前衛で威勢よく、まくしたてる口撃系ドラゴン。\n全体物理攻撃力アップのＵＢは、味方の防御力を下げる\n代わりにＨＰが多いほど効果を高め、味方を勝利に導く。", /*only_disp_owned*/0, /*start_time*/"2021/04/30 12:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/116601, /*unit_name*/"カヤ（タイムトラベル）", /*kana*/"かや", /*prefab_id*/116601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/0, /*motion_type*/1, /*se_type*/1, /*move_speed*/0, /*search_area_width*/0, /*atk_type*/0, /*normal_atk_cast_time*/0.0, /*cutin_1*/0, /*cutin_2*/0, /*cutin1_star6*/0, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/180101, /*unit_name*/"ヒヨリ（プリンセス）", /*kana*/"ひより", /*prefab_id*/180101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/199, /*atk_type*/1, /*normal_atk_cast_time*/1.62, /*cutin_1*/180101, /*cutin_2*/0, /*cutin1_star6*/180101, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/180201, /*unit_name*/"ユイ（プリンセス）", /*kana*/"ゆい", /*prefab_id*/180201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/767, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/180201, /*cutin_2*/0, /*cutin1_star6*/180201, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/180401, /*unit_name*/"ペコリーヌ（プリンセス）", /*kana*/"ぺこりーぬ", /*prefab_id*/180401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/155, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/180401, /*cutin_2*/0, /*cutin1_star6*/180401, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/180501, /*unit_name*/"コッコロ（プリンセス）", /*kana*/"こっころ", /*prefab_id*/180501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/555, /*atk_type*/1, /*normal_atk_cast_time*/2.14, /*cutin_1*/180501, /*cutin_2*/0, /*cutin1_star6*/180501, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
INSERT OR IGNORE INTO `unit_data` VALUES (/*unit_id*/180601, /*unit_name*/"キャル（プリンセス）", /*kana*/"きゃる", /*prefab_id*/180601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/747, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/180601, /*cutin_2*/0, /*cutin1_star6*/180601, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", /*only_disp_owned*/0, /*start_time*/"2021/04/28 12:00:00", /*end_time*/"2021/04/30 11:59:59");
